import React from "react";
import "../css/DisplayFlights.css";

export default function DisplayFlights(props) {
  const { flights } = props;
  let sortType = "BestFlights";

  return (
    <div>
      <div>
        <table className="table">
          <thead>
            {flights &&
              flights.map((flight, index) => (
                <React.Fragment key={flight.flightNumber}>
                  {index === 0 && (
                    <tr>
                      <th colSpan="7">Best departing flights</th>
                    </tr>
                  )}
                  {index === 2 && (
                    <tr>
                      <th colSpan="7">Other departing flights</th>
                    </tr>
                  )}
                  <tr>
                    <th>Flight Number</th>
                    <th>Departure Time</th>
                    <th>Arrival Time</th>
                    <th>Duration</th>
                    <th>Price</th>
                    <th>Ratings</th>
                    <th>Action</th>
                  </tr>
                </React.Fragment>
              ))}
          </thead>
          <tbody>
            {flights &&
              flights.map((flight, index) => (
                <tr key={flight.flightNumber}>
                  <td>
                    {flight.flightNumber}{" "}
                    {sortType === "BestFlights" && index === 0 && (
                      <TopSuggestion />
                    )}
                  </td>
                  <td>{flight.departureTime}</td>
                  <td>{flight.arrivalTime}</td>
                  <td>{flight.duration} hours</td>
                  <td>{flight.price} </td>
                  <td>{flight.userRatings}</td>
                  <td>Place a button to book</td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

function TopSuggestion() {
  return <strong>(Our top recommendation)</strong>;
}
